import React from "react";



function ExerciseList(props)
{
    return( 
      <div className="card" style={{width: "18rem"}}>
        <div className="card-body">
        <Card.Img variant="top" src="https://www.google.com/imgres?q=fitness%20gym&imgurl=https%3A%2F%2Fmedia.istockphoto.com%2Fid%2F1277242852%2Fphoto%2Fholding-weight-and-sitting.jpg%3Fs%3D612x612%26w%3D0%26k%3D20%26c%3D3sy-VVhUYjABpNEMI2aoruXQuOVb__-AUR6BzOHoSJg%3D&imgrefurl=https%3A%2F%2Fwww.istockphoto.com%2Fphotos%2Ffitness-center&docid=gL8dOl7taAuqYM&tbnid=P64u0y-u0jnt6M&vet=12ahUKEwiDgsiqt9qFAxUt4zgGHRmZDP8QM3oECBsQAA..i&w=612&h=408&hcb=2&ved=2ahUKEwiDgsiqt9qFAxUt4zgGHRmZDP8QM3oECBsQAA" />
        <h5 className="card-title">{props.name}</h5>
        <p className="card-text">{props.description}</p>
    
        </div>
      </div>

    );
   
}
export default ExerciseList;
